#!/usr/bin/env node

// Simple test that uses the built nx package
const path = require('path');

async function testHashInspector() {
  console.log('üß™ Simple Hash Inspector Test\n');

  try {
    // First check if the native module exists
    const builtNxPath = path.join(__dirname, 'build/packages/nx');
    console.log('üìÅ Checking for built nx package at:', builtNxPath);

    const fs = require('fs');
    if (!fs.existsSync(builtNxPath)) {
      console.log('‚ùå Built nx package not found. Run: nx build nx');
      return;
    }

    console.log('‚úÖ Built nx package found');

    // Try to require the built modules
    const {
      createProjectGraphAsync,
    } = require('./build/packages/nx/src/project-graph/project-graph');
    const {
      HashPlanInspector,
    } = require('./build/packages/nx/src/hasher/hash-plan-inspector');
    const { readNxJson } = require('./build/packages/nx/src/config/nx-json');

    console.log('‚úÖ Modules loaded successfully');

    // Basic functionality test
    console.log('\nüöÄ Testing basic functionality...');

    const projectGraph = await createProjectGraphAsync();
    console.log(
      `üìä Project graph loaded with ${
        Object.keys(projectGraph.nodes).length
      } projects`
    );

    const nxJson = readNxJson();
    console.log('üìã nx.json loaded');

    const inspector = new HashPlanInspector(nxJson, projectGraph);
    console.log('üîç HashPlanInspector created');

    await inspector.init();
    console.log('‚úÖ HashPlanInspector initialized');

    // Test with a simple target
    const target = { project: 'nx', target: 'build', configuration: undefined };
    console.log(
      `\nüéØ Testing hash plan for ${target.project}:${target.target}`
    );

    const hashPlan = inspector.inspectHashPlan(target);

    if (hashPlan && Object.keys(hashPlan).length > 0) {
      console.log('‚úÖ Hash plan generated successfully!');
      console.log(`üìã Contains ${Object.keys(hashPlan).length} plan entries:`);

      for (const [planKey, files] of Object.entries(hashPlan)) {
        console.log(`  ‚Ä¢ ${planKey}: ${files.length} files`);

        // Show first few files as examples
        if (files.length > 0) {
          files.forEach((file) => console.log(`    ‚Ä¢ ${file}`));
        }
      }
    } else {
      console.log('‚ö†Ô∏è  No hash plan returned');
    }

    console.log('\nüéâ Test completed successfully!');
  } catch (error) {
    console.error('‚ùå Error:', error.message);
    if (error.code === 'MODULE_NOT_FOUND') {
      console.log(
        '\nüí° Tip: Make sure to run "nx build nx" first to build the native components'
      );
    }
  }
}

testHashInspector();
